            <div className="PageBorder">
                <div className="Margin_2">
                    <h1 className="customText_w_medium">{this.state.Title}</h1>
                    <button onClick={this.TurnOnBeamer} className="btn red_BTN btn-block">Remove order</button>
                </div>
            </div>
        );
    }
}    

export default Home;
